> Political Obama stumps for Sen. Murray in Washington state President Barack Obama speaks during a Democratic fundraiser in Seattle, Friday, Oct. 9, 2015. Obama attended the fundraiser event for Murray and he is also attending fundraisers this weekend in San Francisco and Los Angeles as part of a four-day West Coast tour. (AP Photo/Pablo Martinez Monsivais) 
